const config = {
  "previewFeatures": [],
  "clientVersion": "7.0.1",
  "engineVersion": "f09f2815f091dbba658cdcd2264306d88bb5bda6",
  "activeProvider": "postgresql",
  "inlineSchema": "generator client {\n  provider = \"prisma-client-js\"\n  output   = \"../generated/prisma\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n}\n\n// enum RoleName {\n//   ADMIN\n//   TECHNICIAN\n//   USER\n// }\n\nenum AccessLevel {\n  NONE\n  READ\n  WRITE\n}\n\nenum UserStatus {\n  ACTIVE\n  INACTIVE\n  SUSPENDED\n}\n\nenum Criticality {\n  LOW\n  MEDIUM\n  HIGH\n}\n\nenum Condition {\n  GOOD\n  FAIR\n  POOR\n}\n\nenum MainUse {\n  RESIDENTIAL\n  COMMERCIAL\n  CULTURAL\n  OFFICE\n  RECREATIONAL\n  WAREHOUSE\n  EDUCATIONAL\n}\n\nenum ServiceStatus {\n  ACTIVE\n  INACTIVE\n  SUSPENDED\n}\n\nenum Category {\n  APARTMENT\n  HOUSE\n  OFFICE\n  SHOP\n  GARAGE\n  OTHER\n}\n\nenum SiteType {\n  BUILDING\n  COMPLEX\n  FLOOR\n  UNIT\n  ROOM\n}\n\nenum RoomUse {\n  OFFICE\n  DEPOT\n  CANTEEN\n  CELLAR\n  TOILET\n  MEETING_ROOM\n  TECHNICAL_ROOM\n  LABORATORY\n  STORAGE\n}\n\nenum Availability {\n  IN_USE\n  VACANT\n  UNDER_CONSTRUCTION\n  RENT\n}\n\nenum CompanyType {\n  CORPORATE_GROUP\n  CUSTOMER\n  SUPPLIER\n}\n\nenum EmployeeType {\n  CUSTOMER_EMPLOYEE\n  EXTERNAL_EMPLOYEE\n  INTERNAL_EMPLOYEE\n  SUPPLIER_EMPLOYEE\n}\n\nenum Frequency {\n  DAILY\n  WEEKLY\n  MONTHLY\n  YEARLY\n  CUSTOM\n}\n\nenum MaintenanceType {\n  PREVENTIVE // Routine, Scheduled Inspections\n  CORRECTIVE // Breakdown repairs\n  PREDICTIVE // Condition monitoring\n  EMERGENCY // Life safety, rapid response\n  INSPECTION // Periodic compliance checks\n  CALIBRATION // Instrument recalibration\n  SMALL_PROJECT // Renovations, MAC\n  SOFT_SERVICE // Cleaning, landscaping, etc.\n}\n\nenum Status {\n  PENDING\n  IN_PROGRESS\n  COMPLETED\n}\n\nenum ProcessType {\n  MAINTENANCE\n  CORRECTIVE\n}\n\nenum AssetCategoryType {\n  DEVICES\n  FINISHINGS\n  ITEMS\n  MACHINERIES\n}\n\nenum Priority {\n  LOW\n  MEDIUM\n  HIGH\n}\n\nenum StockMovementType {\n  LOAD\n  UNLOAD\n  TRANSFER\n}\n\nenum StockReferenceType {\n  MAINTENANCE\n  PURCHASE_ORDER\n  MANUAL\n  OTHER\n}\n\nenum PerformerReference {\n  USER\n  TEAM\n  COMPANY\n}\n\nenum State {\n  Fct\n  Abia\n  Adamawa\n  AkwaIbom\n  Anambra\n  Bauchi\n  Bayelsa\n  Benue\n  Borno\n  CrossRiver\n  Delta\n  Ebonyi\n  Edo\n  Ekiti\n  Enugu\n  Gombe\n  Imo\n  Jigawa\n  Kaduna\n  Kano\n  Katsina\n  Kebbi\n  Kogi\n  Kwara\n  Lagos\n  Nasarawa\n  Niger\n  Ogun\n  Ondo\n  Osun\n  Oyo\n  Plateau\n  Rivers\n  Sokoto\n  Taraba\n  Yobe\n  Zamfara\n}\n\n// =======================================================================\n// ============================ MODELS =================================== \n// =======================================================================\n\nmodel User {\n  id            String         @id @default(uuid())\n  email         String         @unique\n  password      String\n  firstName     String\n  lastName      String\n  roleId        String\n  status        UserStatus     @default(ACTIVE)\n  createdAt     DateTime       @default(now())\n  updatedAt     DateTime       @updatedAt\n  refreshTokens RefreshToken[]\n  role          Role           @relation(fields: [roleId], references: [id])\n  permissions   Permission[] // Direct permissions\n\n  passwordResetToken String?\n  passwordExpiresAt  DateTime?\n  passwordResetAt    DateTime?\n\n  // Employee Fields\n  employeeCode  String?       @unique\n  employeeType  EmployeeType? @default(CUSTOMER_EMPLOYEE)\n  companyId     String?\n  company       Company?      @relation(fields: [companyId], references: [id])\n  serviceStatus ServiceStatus @default(ACTIVE)\n\n  hourlyRate Decimal @default(0) @db.Decimal(10, 2)\n\n  calenderEntityId String?\n  calenderEntity   CalenderEntity? @relation(fields: [calenderEntityId], references: [id], onDelete: SetNull)\n\n  // Relations\n  teams                 Team[]\n  requestedMaintenances Maintenance[] @relation(\"MaintenanceRequester\")\n  assignedMaintenances  Maintenance[] @relation(\"MaintenanceAssignee\")\n  supervisedTeams       Team[]        @relation(\"TeamSupervisor\")\n\n  costCenterId     String?\n  costCenter       CostCenter?       @relation(fields: [costCenterId], references: [id])\n  purchaseRequests PurchaseRequest[]\n  goodsReceipts    GoodsReceipt[]\n  maintenanceTasks MaintenanceTask[]\n  workLogs         WorkLog[]\n\n  @@index([email])\n  @@index([roleId])\n  @@map(\"users\")\n}\n\nmodel WorkLog {\n  id          String  @id @default(uuid())\n  description String?\n\n  // Who did the work\n  technicianId String\n  technician   User   @relation(fields: [technicianId], references: [id])\n\n  // What work was done\n  maintenanceId String\n  maintenance   Maintenance @relation(fields: [maintenanceId], references: [id])\n\n  // When was the work done\n  startTime         DateTime\n  endTime           DateTime\n  durationInMinutes Decimal  @db.Decimal(10, 2) // automatically (endtime - startime)\n\n  // Financials\n  currentRate Decimal @db.Decimal(10, 2) // automatically (technician.hourlyRate)\n  totalCost   Decimal @db.Decimal(10, 2) // automatically (durationInMinutes * currentRate)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([technicianId])\n  @@index([maintenanceId])\n  @@map(\"worklogs\")\n}\n\nmodel Role {\n  id          String       @id @default(uuid())\n  name        String       @unique\n  isSystem    Boolean      @default(false)\n  description String?\n  createdAt   DateTime     @default(now())\n  updatedAt   DateTime     @updatedAt\n  permissions Permission[]\n  users       User[]\n\n  @@index([name])\n  @@map(\"roles\")\n}\n\nmodel Permission {\n  id          String      @id @default(uuid())\n  roleId      String\n  resource    String\n  accessLevel AccessLevel @default(NONE)\n  createdAt   DateTime    @default(now())\n  updatedAt   DateTime    @updatedAt\n  role        Role        @relation(fields: [roleId], references: [id], onDelete: Cascade)\n  user        User?       @relation(fields: [userId], references: [id])\n  userId      String?\n\n  @@unique([roleId, resource, accessLevel])\n  @@index([roleId])\n  @@map(\"permissions\")\n}\n\nmodel Site {\n  id          String  @id @default(uuid())\n  name        String\n  address     Address @relation(fields: [addressId], references: [id], onDelete: Cascade)\n  climateZone String?\n  description String?\n\n  complexes Complex[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n  addressId String   @unique\n\n  @@map(\"sites\")\n}\n\nmodel Complex {\n  id               String          @id @default(uuid())\n  code             String          @unique\n  name             String\n  availability     Availability    @default(IN_USE)\n  status           ServiceStatus   @default(ACTIVE)\n  calenderEntityId String?\n  calenderEntity   CalenderEntity? @relation(fields: [calenderEntityId], references: [id], onDelete: Cascade)\n\n  // Location\n  secondaryAddress String? // eg Second get entrance\n\n  // Maintenance Date\n  condition   Condition   @default(GOOD)\n  criticality Criticality @default(LOW)\n\n  // Dimensions Data\n  totalBuildings    Int?\n  totalFloors       Int?\n  totalUnits        Int?\n  totalRooms        Int?\n  glazedArea        Float?\n  cleanableArea     Float?\n  coveredArea       Float?\n  totalNetArea      Float?\n  totalGrossArea    Float?\n  totalHeatedVolume Float?\n  totalVolume       Float?\n\n  // Relations\n  buildings Building[]\n  photos    File[]\n\n  createdAt    DateTime      @default(now())\n  updatedAt    DateTime      @updatedAt\n  maintenances Maintenance[]\n  preventives  Preventive[]\n\n  siteId String\n  site   Site   @relation(fields: [siteId], references: [id], onDelete: Cascade)\n\n  @@unique([name, siteId])\n  @@map(\"complexes\")\n}\n\nmodel Building {\n  id   String @id @default(uuid())\n  name String\n  code String @unique\n\n  mainUse      MainUse       @default(RESIDENTIAL)\n  availability Availability  @default(IN_USE)\n  status       ServiceStatus @default(ACTIVE)\n\n  // Maintenance Data\n  condition   Condition   @default(GOOD)\n  criticality Criticality @default(LOW)\n\n  // Dimensional Date\n  totalFloors       Int?\n  totalUnits        Int?\n  totalRooms        Int?\n  glazedArea        Float?\n  cleanableArea     Float?\n  coveredArea       Float?\n  totalNetArea      Float?\n  totalGrossArea    Float?\n  totalHeatedVolume Float?\n  totalVolume       Float?\n\n  // Location\n  subAddress String? // eg Building B, 100 Main St\n\n  complexId String\n  complex   Complex @relation(fields: [complexId], references: [id], onDelete: Cascade)\n\n  calenderEntityId String?\n  calenderEntity   CalenderEntity? @relation(fields: [calenderEntityId], references: [id], onDelete: Cascade)\n\n  photos File[]\n  floors Floor[]\n\n  createdAt    DateTime      @default(now())\n  updatedAt    DateTime      @updatedAt\n  preventives  Preventive[]\n  maintenances Maintenance[]\n  meters       Meter[]\n\n  costCenterId String?\n  costCenter   CostCenter? @relation(fields: [costCenterId], references: [id])\n\n  @@unique([complexId, name])\n  @@map(\"buildings\")\n}\n\nmodel Floor {\n  id     String        @id @default(uuid())\n  code   String        @unique\n  name   String\n  level  Int\n  type   String? // \"office\", \"retail\", \"technical\"\n  status ServiceStatus @default(ACTIVE)\n\n  condition   Condition   @default(GOOD)\n  criticality Criticality @default(LOW)\n\n  // Location Data\n  buildingId String\n  building   Building @relation(fields: [buildingId], references: [id])\n\n  // Dimensions Data\n  totalUnits        Int?\n  totalRooms        Int?\n  glazedArea        Float?\n  cleanableArea     Float?\n  coveredArea       Float?\n  totalNetArea      Float?\n  totalGrossArea    Float?\n  totalHeatedVolume Float?\n  totalVolume       Float?\n\n  zones Zone[]\n\n  createdAt    DateTime      @default(now())\n  updatedAt    DateTime      @updatedAt\n  maintenances Maintenance[]\n  preventives  Preventive[]\n\n  @@unique([buildingId, name])\n  @@map(\"floors\")\n}\n\nmodel Zone {\n  id           String        @id @default(uuid())\n  code         String        @unique\n  name         String\n  type         String? // \"fire compartment\", \"wing\", \"tenant demarcation\"\n  availability Availability  @default(IN_USE)\n  status       ServiceStatus @default(ACTIVE)\n\n  calenderEntityId String?\n  calenderEntity   CalenderEntity? @relation(fields: [calenderEntityId], references: [id], onDelete: Cascade)\n\n  // Address\n  floorId String\n  floor   Floor  @relation(fields: [floorId], references: [id], onDelete: Cascade)\n\n  // Maintenance Data\n  totalRooms        Int?\n  glazedArea        Float?\n  cleanableArea     Float?\n  coveredArea       Float?\n  totalNetArea      Float?\n  totalGrossArea    Float?\n  totalHeatedVolume Float?\n  totalVolume       Float?\n\n  // Cadastral Data\n  cadastralArea           Float?\n  urbanSection            String?\n  sheet                   String?\n  plot                    String?\n  subordinate             String?\n  class                   Int?\n  size                    Float?\n  propertyRightsAndDuties String?\n  cadastralIncome         Decimal?\n  censusArea              String?\n  subArea                 String?\n\n  rooms  Space[]\n  photos File[]\n  items  MaintenanceItem[]\n  meters Meter[]\n\n  createdAt    DateTime      @default(now())\n  updatedAt    DateTime      @updatedAt\n  maintenances Maintenance[]\n  preventives  Preventive[]\n\n  @@unique([floorId, name])\n  @@map(\"zones\")\n}\n\nmodel Space {\n  id     String        @id @default(uuid())\n  name   String\n  code   String        @unique\n  use    RoomUse       @default(OFFICE)\n  status ServiceStatus @default(ACTIVE)\n\n  calenderEntityId String?\n  calenderEntity   CalenderEntity? @relation(fields: [calenderEntityId], references: [id], onDelete: Cascade)\n\n  // Location Data\n\n  zoneId String\n  zone   Zone   @relation(fields: [zoneId], references: [id])\n\n  // Maintenance Data\n  condition   Condition   @default(GOOD)\n  criticality Criticality @default(LOW)\n\n  // Dimensions Data\n  glazedArea     Float?\n  cleanableArea  Float?\n  coveredArea    Float?\n  totalNetArea   Float?\n  totalGrossArea Float?\n  height         Int?\n  heated         Boolean @default(false)\n  totalVolume    Float?\n\n  photos File[]\n\n  createdAt    DateTime      @default(now())\n  updatedAt    DateTime      @updatedAt\n  maintenances Maintenance[]\n  preventives  Preventive[]\n  meters       Meter[]\n\n  assets Asset[]\n\n  @@unique([zoneId, name])\n  @@map(\"spaces\")\n}\n\n// Assets\n// categories - devices, finishings, items, machineries\n// subcategories - devices: burglar devices, electrical devices, climate control devices etc.\n// asset - door, window, siren, etc.\n\nmodel AssetType {\n  id   String @id @default(uuid())\n  name String @unique\n}\n\nmodel AssetCategory {\n  id          String            @id @default(uuid())\n  name        String            @unique\n  type        AssetCategoryType @default(DEVICES)\n  description String?\n  assets      Asset[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([type])\n  @@index([name])\n  @@map(\"asset_categories\")\n}\n\nmodel Asset {\n  id          String        @id @default(uuid())\n  name        String\n  description String?\n  categoryId  String\n  category    AssetCategory @relation(fields: [categoryId], references: [id], onDelete: Cascade)\n\n  tag            String? @unique\n  parentSystemId String?\n  parentSystem   Asset?  @relation(\"AssetHierarchy\", fields: [parentSystemId], references: [id])\n  childAssets    Asset[] @relation(\"AssetHierarchy\")\n\n  spaceId String?\n  space   Space?  @relation(fields: [spaceId], references: [id])\n\n  createdAt    DateTime      @default(now())\n  updatedAt    DateTime      @updatedAt\n  maintenances Maintenance[]\n  preventives  Preventive[]\n  meters       Meter[]\n\n  costCenterId String?\n  costCenter   CostCenter? @relation(fields: [costCenterId], references: [id])\n\n  @@index([name])\n  @@map(\"assets\")\n}\n\nmodel File {\n  id  String @id @default(uuid())\n  url String @unique\n\n  spaces        Space[]\n  zones         Zone[]\n  buildings     Building[]\n  complexes     Complex[]\n  maintenance   Maintenance? @relation(fields: [maintenanceId], references: [id])\n  maintenanceId String?\n\n  @@map(\"files\")\n}\n\nmodel Company {\n  id          String      @id @default(uuid())\n  code        String      @unique\n  type        CompanyType @default(CORPORATE_GROUP)\n  name        String\n  description String\n\n  address   Address @relation(fields: [addressId], references: [id], onDelete: Cascade)\n  addressId String\n\n  phone            String?\n  alternativePhone String?\n  email            String?\n  website          String?\n\n  createdAt      DateTime        @default(now())\n  updatedAt      DateTime        @updatedAt\n  employees      User[]\n  maintenances   Maintenance[]\n  purchaseOrders PurchaseOrder[]\n  goodsReceipts  GoodsReceipt[]\n\n  @@map(\"companies\")\n}\n\nmodel Team {\n  id          String  @id @default(uuid())\n  code        String  @unique\n  name        String\n  description String?\n\n  status ServiceStatus @default(ACTIVE)\n\n  supervisorId String\n  supervisor   User   @relation(\"TeamSupervisor\", fields: [supervisorId], references: [id], onDelete: Cascade)\n\n  createdAt    DateTime      @default(now())\n  updatedAt    DateTime      @updatedAt\n  maintenances Maintenance[]\n  preventives  Preventive[]\n  members      User[]\n\n  @@map(\"teams\")\n}\n\nmodel Address {\n  id        String  @id @default(uuid())\n  street    String\n  city      String\n  state     State   @default(Lagos)\n  zipCode   String?\n  latitude  Float?\n  longitude Float?\n\n  companies  Company[]\n  sites      Site[]\n  warehouses Warehouse[]\n\n  @@unique([street, city, state, zipCode])\n  @@map(\"addresses\")\n}\n\nmodel Contract {\n  id          String @id @default(uuid())\n  code        String @unique\n  description String\n}\n\nmodel CalenderEntity {\n  id   String @id @default(uuid())\n  name String\n\n  buildings Building[]\n  complexes Complex[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n  spaces    Space[]\n  zones     Zone[]\n  employees User[]\n\n  @@map(\"calender_entities\")\n}\n\nmodel Maintenance {\n  id               String          @id @default(uuid())\n  type             MaintenanceType @default(PREVENTIVE)\n  code             String          @unique\n  description      String\n  startDate        DateTime?\n  endDate          DateTime?\n  shortDescription String?\n  action           String? // Lookup\n  message          String?\n  processNotes     String?\n  metadata         Json? // Use Zod schema to validate based on type\n\n  performerId        String?\n  performerReference PerformerReference?\n\n  processStatus     Status      @default(PENDING)\n  register          String?\n  activityIdTimer   String?\n  activityStartTime DateTime?\n  activityEndTime   DateTime?\n  allDeadlines      String?\n  processType       ProcessType @default(CORRECTIVE)\n  ttSysRunning      Decimal?\n  ttWorkRunning     Decimal?\n  sorting           String?\n\n  requesterId String?\n  requester   User?   @relation(\"MaintenanceRequester\", fields: [requesterId], references: [id], onDelete: Cascade)\n\n  priority Priority @default(LOW)\n\n  siteId String\n  site   Complex @relation(fields: [siteId], references: [id], onDelete: Cascade)\n\n  costCenterId String?\n  costCenter   CostCenter? @relation(fields: [costCenterId], references: [id])\n\n  outcome        String? // Lookup\n  dueAssignedEnd DateTime? // Execution end date\n  execStart      DateTime? // Execution start date\n  dueExecEndDate DateTime? // Due execution end date\n  execEndDate    DateTime? // Execution end date\n  dueClosureDate DateTime? // Due closure date\n  totalExecTime  Decimal? // Total execution time\n\n  expStartDate DateTime?\n\n  suspensionReason String? // Lookup\n\n  category    String? // Reference\n  subCategory String? // Reference\n\n  companyId String? // Reference\n  company   Company? @relation(fields: [companyId], references: [id])\n\n  buildingId String?\n  building   Building? @relation(fields: [buildingId], references: [id])\n\n  teamId  String?\n  team    Team?   @relation(fields: [teamId], references: [id], onDelete: Cascade)\n  floorId String?\n  floor   Floor?  @relation(fields: [floorId], references: [id], onDelete: Cascade)\n  zoneId  String?\n  zone    Zone?   @relation(fields: [zoneId], references: [id], onDelete: Cascade)\n  spaceId String?\n  space   Space?  @relation(fields: [spaceId], references: [id], onDelete: Cascade)\n\n  ttSystemOpening    Decimal?\n  ttWorkOpening      Decimal?\n  ttSystemAssignment Decimal?\n  ttWorkAssignment   Decimal?\n  ttSystemExecution  Decimal?\n  ttWorkExecution    Decimal?\n  ttSysSuspension    Decimal?\n  ttWorkSuspension   Decimal?\n  ttEstimate         Decimal?\n\n  ttLaborCost Decimal?\n\n  // For preventive\n  prevMaintenanceConfigId String? // For Preventive\n  automaticConfig         Boolean @default(true)\n  jointAccounting         Boolean @default(false)\n  hasTasks                Boolean @default(false)\n\n  estimateStatus Status @default(PENDING)\n\n  delayNotification Boolean @default(false)\n  assigneeId        String?\n  assignee          User?   @relation(\"MaintenanceAssignee\", fields: [assigneeId], references: [id], onDelete: Cascade)\n\n  assetId String?\n  asset   Asset?  @relation(fields: [assetId], references: [id])\n\n  photos File[]\n\n  createdAt        DateTime          @default(now())\n  updatedAt        DateTime          @updatedAt\n  maintenanceItems MaintenanceItem[]\n  maintenanceTasks MaintenanceTask[]\n  workLogs         WorkLog[]\n\n  @@map(\"maintenances\")\n}\n\nmodel Preventive {\n  id             String    @id @default(uuid())\n  code           String    @unique\n  name           String\n  description    String\n  frequency      Frequency @default(MONTHLY)\n  cronExpression String? // For CUSTOM frequency\n\n  // Scheduling\n  lastRun DateTime?\n  nextRun DateTime\n\n  // Template Data for created Maintenance tasks\n  priority Priority @default(MEDIUM)\n  duration Int? // Estimated duration in minutes\n\n  // Relations (Template targets)\n  siteId String\n  site   Complex @relation(fields: [siteId], references: [id], onDelete: Cascade)\n\n  assetId String?\n  asset   Asset?  @relation(fields: [assetId], references: [id])\n\n  buildingId String?\n  building   Building? @relation(fields: [buildingId], references: [id])\n\n  floorId String?\n  floor   Floor?  @relation(fields: [floorId], references: [id])\n\n  zoneId String?\n  zone   Zone?   @relation(fields: [zoneId], references: [id])\n\n  spaceId String?\n  space   Space?  @relation(fields: [spaceId], references: [id])\n\n  teamId String?\n  team   Team?   @relation(fields: [teamId], references: [id])\n\n  meterTriggers MeterMaintenanceTrigger[]\n\n  createdAt       DateTime         @default(now())\n  updatedAt       DateTime         @updatedAt\n  preventiveTasks PreventiveTask[]\n\n  @@map(\"preventives\")\n}\n\n// The \"Template\" (What SHOULD be done)\nmodel PreventiveTask {\n  id          String  @id @default(uuid())\n  description String // e.g. \"Check Oil Level\"\n  order       Int // To keep steps 1, 2, 3 in sequence\n  isMandatory Boolean @default(true)\n\n  preventiveId String\n  preventive   Preventive @relation(fields: [preventiveId], references: [id], onDelete: Cascade)\n\n  @@map(\"preventive_tasks\")\n}\n\n// The \"Instance\" (What WAS done on a specific ticket)\nmodel MaintenanceTask {\n  id          String    @id @default(uuid())\n  description String\n  isCompleted Boolean   @default(false)\n  completedAt DateTime?\n  notes       String? // e.g. \"Oil was extremely dirty\"\n\n  maintenanceId String\n  maintenance   Maintenance @relation(fields: [maintenanceId], references: [id], onDelete: Cascade)\n\n  // Link to the user who checked the box? (Optional but good for audit)\n  completedById String?\n  completedBy   User?   @relation(fields: [completedById], references: [id])\n\n  @@map(\"maintenance_tasks\")\n}\n\nmodel Warehouse {\n  id          String  @id @default(uuid())\n  // status         WarehouseStatus         Abandoned, Active, Inactive\n  name        String\n  description String?\n\n  address   Address @relation(fields: [addressId], references: [id], onDelete: Cascade)\n  addressId String\n\n  stocks                 Stock[]\n  stockMovements         StockMovement[] @relation(\"WarehouseStockMovements\")\n  incomingStockMovements StockMovement[] @relation(\"TargetWarehouseStockMovements\")\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"warehouses\")\n}\n\nmodel Item {\n  id            String  @id @default(uuid())\n  name          String  @unique\n  description   String?\n  code          String  @unique\n  category      String?\n  unitOfMeasure String?\n  cost          Decimal @db.Decimal(15, 2)\n\n  stocks           Stock[]\n  stockMovements   StockMovement[]\n  maintenanceItems MaintenanceItem[]\n\n  createdAt            DateTime              @default(now())\n  updatedAt            DateTime              @updatedAt\n  purchaseOrderItems   PurchaseOrderItem[]\n  purchaseRequestItems PurchaseRequestItem[]\n  goodsReceiptItems    GoodsReceiptItem[]\n\n  @@map(\"items\")\n}\n\nmodel Stock {\n  id          String @id @default(uuid())\n  quantity    Int    @default(0)\n  minQuantity Int    @default(0) // For alerts\n  maxQuantity Int? // Optional max capacity\n\n  itemId String\n  item   Item   @relation(fields: [itemId], references: [id])\n\n  warehouseId String\n  warehouse   Warehouse @relation(fields: [warehouseId], references: [id])\n\n  @@unique([itemId, warehouseId])\n  @@map(\"stocks\")\n}\n\nmodel StockMovement {\n  id       String            @id @default(uuid())\n  type     StockMovementType @default(LOAD) // transfering stsocks should be done using prisma transactions\n  quantity Int               @default(0)\n\n  itemId String\n  item   Item   @relation(fields: [itemId], references: [id])\n\n  warehouseId String\n  warehouse   Warehouse @relation(\"WarehouseStockMovements\", fields: [warehouseId], references: [id])\n\n  targetWarehouseId String?\n  targetWarehouse   Warehouse? @relation(\"TargetWarehouseStockMovements\", fields: [targetWarehouseId], references: [id])\n\n  // Context & Traceability\n  referenceId   String?\n  referenceType StockReferenceType @default(MAINTENANCE)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"stock_movements\")\n}\n\n// model ConsumedPart {\n//   id       String @id @default(uuid())\n//   quantity Int\n\n//   referenceId   String?\n//   referenceType StockReferenceType\n\n//   itemId String\n//   item   Item   @relation(fields: [itemId], references: [id], onDelete: Restrict)\n\n//   // usedBy User? @relation(fields: [usedById], references: [id], onDelete: SetNull)\n//   // usedById String?\n\n//   createdAt     DateTime     @default(now())\n//   updatedAt     DateTime     @updatedAt\n//   maintenance   Maintenance? @relation(fields: [maintenanceId], references: [id])\n//   maintenanceId String?\n\n//   @@map(\"consumed_parts\")\n// }\n\nmodel MaintenanceItem {\n  id       String   @id @default(uuid())\n  quantity Int\n  cost     Decimal? @default(0)\n\n  maintenanceId String\n  maintenance   Maintenance @relation(fields: [maintenanceId], references: [id], onDelete: Cascade)\n\n  itemId String\n  item   Item   @relation(fields: [itemId], references: [id], onDelete: Restrict)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n  zone      Zone?    @relation(fields: [zoneId], references: [id])\n  zoneId    String?\n\n  @@unique([maintenanceId, itemId])\n  @@map(\"maintenance_items\")\n}\n\nmodel RefreshToken {\n  id        String   @id @default(uuid())\n  token     String   @unique\n  userId    String\n  expiresAt DateTime\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n  user      User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@index([token])\n  @@index([userId])\n  @@map(\"refresh_tokens\")\n}\n\n// =======================================================================\n// =========================== METERING ================================== \n// =======================================================================\n\nenum MeterType {\n  CUMULATIVE // e.g., Odometer, Water Meter (Always increases)\n  GAUGE // e.g., Temperature, Pressure (Fluctuates)\n}\n\nenum MeterReadingSource {\n  MANUAL\n  IOT_API\n  CSV_IMPORT\n}\n\nenum TriggerCondition {\n  EVERY_X_UNITS // For Cumulative: Trigger every 1000 hours\n  ABOVE_THRESHOLD // For Gauge: Trigger if > 80 degrees\n  BELOW_THRESHOLD // For Gauge: Trigger if < 10 psi\n}\n\nmodel Meter {\n  id   String    @id @default(uuid())\n  name String\n  type MeterType @default(CUMULATIVE)\n  unit String // e.g., \"kWh\", \"Hours\", \"Degrees\"\n\n  // Location/Asset Attachment (Polymorphic-style: Only one should be set)\n  assetId    String?\n  asset      Asset?    @relation(fields: [assetId], references: [id])\n  buildingId String?\n  building   Building? @relation(fields: [buildingId], references: [id])\n  zoneId     String?\n  zone       Zone?     @relation(fields: [zoneId], references: [id])\n  spaceId    String?\n  space      Space?    @relation(fields: [spaceId], references: [id])\n\n  readings           MeterReading[]\n  preventiveTriggers MeterMaintenanceTrigger[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"meters\")\n}\n\nmodel MeterReading {\n  id        String             @id @default(uuid())\n  value     Decimal            @db.Decimal(10, 2)\n  timestamp DateTime           @default(now())\n  source    MeterReadingSource @default(MANUAL)\n\n  meterId String\n  meter   Meter  @relation(fields: [meterId], references: [id], onDelete: Cascade)\n\n  // Traceability\n  recordedByUserId String?\n\n  createdAt DateTime @default(now())\n\n  @@index([meterId, timestamp])\n  @@map(\"meter_readings\")\n}\n\nmodel MeterMaintenanceTrigger {\n  id String @id @default(uuid())\n\n  meterId String\n  meter   Meter  @relation(fields: [meterId], references: [id], onDelete: Cascade)\n\n  preventiveId String\n  preventive   Preventive @relation(fields: [preventiveId], references: [id], onDelete: Cascade)\n\n  condition    TriggerCondition\n  triggerValue Decimal          @db.Decimal(10, 2) // The \"X\" in Every X, or the Threshold\n\n  // State tracking for Cumulative triggers\n  lastTriggerReading Decimal? @db.Decimal(10, 2) // Reading value when last triggered\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([preventiveId])\n  @@map(\"meter_maintenance_triggers\")\n}\n\n// =======================================================================\n// =================== FINANCIAL & LOGISTICS ============================= \n// =======================================================================\n\nmodel CostCenter {\n  id              String  @id @default(uuid())\n  code            String  @unique\n  name            String\n  description     String?\n  budgetLimit     Decimal @default(0) @db.Decimal(15, 2)\n  budgetSpent     Decimal @default(0) @db.Decimal(15, 2)\n  budgetCommitted Decimal @default(0) @db.Decimal(15, 2)\n  fiscalYear      Int\n\n  validFrom DateTime?\n  validTo   DateTime?\n\n  // Relations\n  purchaseOrders PurchaseOrder[]\n  maintenances   Maintenance[]\n\n  users     User[]\n  assets    Asset[]\n  buildings Building[]\n\n  createdAt        DateTime          @default(now())\n  updatedAt        DateTime          @updatedAt\n  purchaseRequests PurchaseRequest[]\n\n  @@map(\"cost_centers\")\n}\n\nenum PurchaseStatus {\n  PENDING\n  APPROVED\n  REJECTED\n}\n\nmodel PurchaseRequest {\n  id          String         @id @default(uuid())\n  description String\n  status      PurchaseStatus @default(PENDING) // PENDING, APPROVED, REJECTED\n\n  requesterId  String\n  requester    User       @relation(fields: [requesterId], references: [id])\n  costCenterId String\n  costCenter   CostCenter @relation(fields: [costCenterId], references: [id])\n\n  items PurchaseRequestItem[]\n\n  createdAt      DateTime        @default(now())\n  updatedAt      DateTime        @updatedAt\n  purchaseOrders PurchaseOrder[]\n\n  @@map(\"purchase_requests\")\n}\n\nmodel PurchaseRequestItem {\n  id String @id @default(uuid())\n\n  purchaseRequestId String\n  purchaseRequest   PurchaseRequest @relation(fields: [purchaseRequestId], references: [id], onDelete: Cascade)\n\n  itemId String\n  item   Item   @relation(fields: [itemId], references: [id])\n\n  quantity Int\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"purchase_request_items\")\n}\n\nenum PurchaseOrderStatus {\n  DRAFT\n  ISSUED\n  PARTIALLY_RECEIVED\n  RECEIVED\n  CLOSED\n}\n\nmodel PurchaseOrder {\n  id     String              @id @default(uuid())\n  status PurchaseOrderStatus @default(DRAFT)\n\n  purchaseRequestId String\n  purchaseRequest   PurchaseRequest @relation(fields: [purchaseRequestId], references: [id], onDelete: Cascade)\n\n  supplierId String\n  supplier   Company @relation(fields: [supplierId], references: [id])\n\n  costCenterId String\n  costCenter   CostCenter @relation(fields: [costCenterId], references: [id])\n\n  totalAmount Decimal @default(0) @db.Decimal(15, 2)\n\n  items PurchaseOrderItem[]\n\n  createdAt     DateTime       @default(now())\n  updatedAt     DateTime       @updatedAt\n  goodsReceipts GoodsReceipt[]\n\n  @@map(\"purchase_orders\")\n}\n\nmodel PurchaseOrderItem {\n  id              String        @id @default(uuid())\n  purchaseOrderId String\n  purchaseOrder   PurchaseOrder @relation(fields: [purchaseOrderId], references: [id], onDelete: Cascade)\n\n  itemId String\n  item   Item   @relation(fields: [itemId], references: [id])\n\n  quantity   Int\n  unitPrice  Decimal @db.Decimal(15, 2)\n  totalPrice Decimal @db.Decimal(15, 2)\n\n  @@map(\"purchase_order_items\")\n}\n\nmodel GoodsReceipt {\n  id   String  @id @default(uuid())\n  note String?\n\n  receivedAt DateTime @default(now())\n\n  purchaseOrderId String\n  purchaseOrder   PurchaseOrder @relation(fields: [purchaseOrderId], references: [id], onDelete: Cascade)\n\n  items GoodsReceiptItem[]\n\n  receiverId String\n  receiver   User   @relation(fields: [receiverId], references: [id])\n\n  companyId String\n  company   Company @relation(fields: [companyId], references: [id])\n\n  @@map(\"goods_receipts\")\n}\n\nmodel GoodsReceiptItem {\n  id String @id @default(uuid())\n\n  goodsReceiptId String\n  goodsReceipt   GoodsReceipt @relation(fields: [goodsReceiptId], references: [id], onDelete: Cascade)\n\n  itemId String\n  item   Item   @relation(fields: [itemId], references: [id])\n\n  quantity Int\n\n  @@map(\"goods_receipt_items\")\n}\n"
}

